import { Button } from "@mui/material";
import React from "react";
import { Link, useNavigate, useParams } from "react-router-dom";

const UserDetails = () => {
  const params = useParams();
  const navigate = useNavigate();
  const mystyle = {
    backgroundImage: "url('/backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  const { name } = params;

  return (
    <div style={mystyle}>
      <h1>UserDetails</h1>
      <br />
      <h2> This is {name} Users data.</h2>

      {/* <Button onClick={}> Back to User List</Button> */}
      <br></br>
      <Button
        component={Link}
        to="/users"
        style={{
          textDecoration: "none",
          color: "white",
          backgroundColor: "#FFB300",
        }}
      >
        Back To User List
      </Button>
      <br></br>
      <br></br>

      <Button
        style={{
          textDecoration: "none",
          color: "white",
          backgroundColor: "#FFB300",
        }}
        onClick={() => {
          navigate("/");
        }}
      >
        Go To Home Page
      </Button>
    </div>
  );
};

export default UserDetails;
